	(50,'http://www.villagevoice.com/events/monday-night-bingo-433988/','Monday Night Bingo','monday-night-bingo','How many creative ways can one call out \"O-69\"? Leave it up to Linda Simpson and Murray Hill, denizens of the downtown gaming world, to try and get a rise out of the jackpot-hungry players when that fateful coordinate comes up.  Monday Night Bingo  has brought their innuendos, wisecracks, and truly bizarre prize booty to the masses as they\'ve hopped clubs over the years. In the wake of the dear Rapture Café\'s demise, Bingo lives on at the Bowery Poetry Club. Expect the usual silly wares for winners, such as a remote-control fart machine and VHS-format porn.',4,'2011-06-14 15:51:23','2011-06-14 15:51:23','http://www.villagevoice.com/events/monday-night-bingo-433988/','http://vvoice.vo.llnwd.net/e14//2599502.47.jpg','',169,'event_images/cec29a80295c00f93b5063ca5be3ba5844fcf104_3.jpg',1,9),
