	(144,'http://www.villagevoice.com/events/baby-gramps-2614557/','Baby Gramps','baby-gramps','This eccentric, bearded codger has been singing and strumming his head-spinning repertoire of blues, folk, novelty, kids\' songs, and palindromic originals since 1964 in a voice that blends Mississippi John Hurt, Popeye, and your favorite Tuvan throat singers. He\'s no slouch on the National steel guitar, either. We don\'t get enough hippie vaudeville around here, so catch this Pacific Northwest original while you can.',4,'2011-06-14 15:51:35','2011-06-14 15:51:35','http://www.villagevoice.com/events/baby-gramps-2614557/','http://vvoice.vo.llnwd.net/e14//6533396.47.jpg','',137,'event_images/14089feb2e7fca808cae8677fdbc16dd5f2271f9_1.jpg',1,2),
