	(146,'http://www.villagevoice.com/events/the-illusion-2559079/','The Illusion','the-illusion','It isnt an exaggeration to consider Tony Kushner a magician of a sort, able to conjure hilarious, hallucinatory, deeply felt, and politically engaged theater. The Signature caps its Kushner season with this revival of his adaptation of the Pierre Corneille tragicomedy about a father who turns to a sorcerer for news of his estranged son.',4,'2011-06-14 15:51:36','2011-06-14 15:51:36','http://www.villagevoice.com/events/the-illusion-2559079/','http://vvoice.vo.llnwd.net/e14//6331227.47.jpg','',125,'event_images/1622a4890e20daef94bd1f9d28dff4f72a73e9f7_2.jpg',1,0),
