	(676,'http://www.villagevoice.com/events/slavic-soul-party-155084/','\'Slavic Soul Party\'','slavic-soul-party','Slavic Soul Party are Eastern Europe\'s answer to the funk (and \"Grunt\") of the J.B.\'s or, more recently, the Budos Band. On their recordings, and every Tuesday at Barbès, the 10-person brass ensemble pins Gypsy melodies against the sort of jazzy r&b horn collages you hear in movies adapted from Elmore Leonard books. The best part, though, is how they interact with their audience at their concerts, sometimes breaking the fourth wall, and really making each word in their nameespecially the lastpull its weight.',4,'2011-06-14 15:52:45','2011-06-14 15:52:45','http://www.villagevoice.com/events/slavic-soul-party-155084/','http://vvoice.vo.llnwd.net/e14//4232102.47.jpg','',137,'event_images/de583f9ff8af84574060ee6edb8026ef1fc0e2bc_2.jpg',1,2),
