	(165,'http://www.villagevoice.com/events/brooklyn-navy-yard-bus-tour-2370828/','Brooklyn Navy Yard Bus Tour','brooklyn-navy-yard-bus-tour','A Bus tour including stories of the Navy Yard\'s past, present, future.  Hope off the bus for some closer looks at the Yard\'s most intriguing sites.',4,'2011-06-14 15:51:38','2011-06-14 15:51:38','http://www.villagevoice.com/events/brooklyn-navy-yard-bus-tour-2370828/','','',117,'',1,0),
