	(342,'http://www.villagevoice.com/events/mike-birbiglias-my-girlfriendand-146-s-boyfriend-2433133/','Mike Birbiglia\'s My Girlfriends Boyfriend','mike-birbiglias-my-girlfriends-boyfriend','Sex and the City  taught us how much it can suck to be a single woman in the city. And now  Mike Birbiglia\'s My Girlfriend\'s Boyfriend  proves that it\'s not all that much simpler to be a single man. Birbiglia, the writer-performer of the hit show  Sleepwalk With Me , which was about his real-life problems with somnambulism, shares his honest, self-deprecating tales of trying to find the right girl, from the schoolyard to adulthood. But don\'t pity him too muchhe\'s happily married now. Seth Barrish directs the heartache.',4,'2011-06-14 15:52:01','2011-06-14 15:52:01','http://www.villagevoice.com/events/mike-birbiglias-my-girlfriendand-146-s-boyfriend-2433133/','http://vvoice.vo.llnwd.net/e14//6095444.47.jpg','',125,'event_images/24878281b3e6574f94555962021810d03fee6c1d_2.jpg',1,0),
