	(354,'http://www.villagevoice.com/events/neil-gaiman-2622537/','Neil Gaiman','neil-gaiman','Neil Gaiman , the author of the bestselling graphic-novel series  The Sandman  and novels  Stardust  and  Coraline , which were both turned into major feature films, certainly has a knack for making hits. Now another one may be in the works: It was recently announced that HBO would be developing his 2001 novel  American Gods  for a potential series (\"Everything\'s looking really promising so far,\" the British writer reported on his blog). In support of the 10th anniversary re-release of  American Gods , the widely acclaimed book about an ex-convict named Shadow and two sets of gods preparing for an epic battle, Gaiman will be making an appearance at 92Y to discuss his career and perhaps reveal something more about this HBO deal. Lev Grossman, author of  The Magicians  and book critic at  Time  magazine, leads the conversation.',4,'2011-06-14 15:52:03','2011-06-14 15:52:03','http://www.villagevoice.com/events/neil-gaiman-2622537/','http://vvoice.vo.llnwd.net/e14//6533742.47.jpg','',34,'event_images/57aeee9e9c29a12852b880a29c0c519f92c178a6_1.jpg',1,0),
