	(403,'http://www.villagevoice.com/events/rock-of-ages-934355/','Rock of Ages','rock-of-ages','Rock of Ages, the celebrated hymn based on First Corinthians, will not appear in this Broadway musical. Instead expect the hits of Foreigner, Styx, Pat Benatar, and Journey sung by a cast that includes American Idol\'s Constantine Maroulis (who was nominated for a Tony). The nominal plot centers on a romance conducted in the unsalubrious environs of the Sunset Strip circa 1987.',4,'2011-06-14 15:52:09','2011-06-14 15:52:09','http://www.villagevoice.com/events/rock-of-ages-934355/','http://vvoice.vo.llnwd.net/e14//3150071.47.jpg','',124,'event_images/5a7334a90bb454eded0ed7128080f9d8ecc8cf52_2.jpg',1,0),
