	(429,'http://www.villagevoice.com/events/karthik-pandian-2285254/','Karthik Pandian','karthik-pandian','The Los Angelesbased artist  Karthik Pandian  has a way of capturing the most minimal things, like an eye or a graffitied wall, as he did in his 2008 16mm film installation called Darkroom, and heightening them with a vintage aesthetic. In his newest show,  Unearth , Pandian investigates the remnants of the Native American City of Cahokia (in Illinois). The result is his own ancient-like treasure in which he has constructed five massive pillars made of rammed earth with layers of other materials, including shells and strips of 16mm film, embedded like strata in order to show the relationship between ancient and modern cultures and the ways in which contemporary societies understand and treat the monuments of societies past.',4,'2011-06-14 15:52:13','2011-06-14 15:52:13','http://www.villagevoice.com/events/karthik-pandian-2285254/','http://vvoice.vo.llnwd.net/e14//5755626.47.jpg','',121,'event_images/4a96d8d0a2490afe0655303aebc16dedcc3956e3_2.jpg',1,0),
