	(900,'http://www.villagevoice.com/events/alexander-mcqueen-savage-beauty-2532933/','Alexander McQueen: Savage Beauty','alexander-mcqueen-savage-beauty','Once a year, the Metropolitan Museum of Art present an illuminating exhibition about fashion. But this year, it shines even brighter with  Alexander McQueen: Savage Beauty , a celebration of the iconic designs by the late designer and couturier. This retrospective extends from McQueens extraordinary contributions to fashion, stretching from his Central Saint Martins postgraduate collection in 1992 to his final runway presentation, which took place after his death at age 40 in February 2010. Approximately 100 ensembles and 70 accessories will be on display. McQueen once said, There is no better designer than nature, and indeed youll see everything from an exquisite jacket made of gold feathers, to a springtime gown dripping with purple and pink flowers, to a futuristic blue-and-yellow disco minidress adorned with snakeskin-like scales that cover the body from the neck all the way down to those infamous hoof-like heels.',4,'2011-06-14 15:53:14','2011-06-14 15:53:14','http://www.villagevoice.com/events/alexander-mcqueen-savage-beauty-2532933/','http://vvoice.vo.llnwd.net/e14//6253039.47.jpg','',127,'event_images/30d8853d813267ad18214b411eef87eee70b06a5_2.jpg',1,0),
