	(978,'http://www.villagevoice.com/events/the-new-york-city-downtown-boathouse-927609/','The New York City Downtown Boathouse','the-new-york-city-downtown-boathouse','The Downtown Boathouse in Manhattan offers free access to the Hudson River as well as loaner kayaks, equipment, and instructions.  Open throughout the days on weekends, some weeknights.  Pier 26 - between Canal and Chambers Streets, Tribeca Pier 64 - at 24th Street, Chelsea There are also piers at:  Pier 40 - the western end of Houston Street on the river side of the West Side Highway. Pier 96 - Clinton Cove Park (at 56th St.) 72nd St. - Riverside Park, approximately at 72nd St. Take the 72nd St. stairs into the park and follow the walkway to the river.',4,'2011-06-14 15:53:25','2011-06-14 15:53:25','http://www.villagevoice.com/events/the-new-york-city-downtown-boathouse-927609/','','',4,'',1,0),
