	(1027,'http://www.villagevoice.com/events/john-zorn-and-tyshawn-sorey-2621143/','John Zorn & Tyshawn Sorey','john-zorn-tyshawn-sorey','Drummer Sorey is one of the most engaging wild cards on the local improv scene--a master of quiet chemistry at one gig and pummeling percussion at the next. Bet his pow-wow with experimental maestro Zorn yields the kind of acute dynamics that generate an edge-of-your-seat vibe. If there is one thing that they both agree upon, it\'s dramatic impact. Tim Berne\'s Los Totopos shares the bill.',4,'2011-06-14 15:53:31','2011-06-14 15:53:31','http://www.villagevoice.com/events/john-zorn-and-tyshawn-sorey-2621143/','http://vvoice.vo.llnwd.net/e14//6533324.47.jpg','',137,'event_images/8954619a3f8d2b635d251bea3e1d162dda6a0c22_1.jpg',1,2),
	(1028,'http://www.villagevoice.com/events/justin-vivian-bond-2593018/','Justin Vivian Bond','justin-vivian-bond','',4,'2011-06-14 15:53:31','2011-06-14 15:53:31','http://www.villagevoice.com/events/justin-vivian-bond-2593018/','','',137,'',1,2),
	(1029,'http://www.villagevoice.com/events/nancy-grossman-2588041/','Nancy Grossman','nancy-grossman','You don\'t need to have an s/m fetish to like the work of veteran artist Nancy Grossmanbut it doesn\'t hurt if you do. Her latest solo exhibition,  Heads , features 14 sculpturesferocious leather-hooded heads carved from blocks of found woodthat she made from the \'60s through the \'80s. Though Grossman is accomplished in many areas of art, it was her heads that made her a star of the art world in the 1960s, with five solo shows by the time she turned 30. Both Robert Mapplethorpe and Richard Avedon memorably photographed her masks of zippers, spikes, straps, and recycled leather (including material from boxing gloves!). Though Grossman has called these lifesize heads \"self-portraits,\" they are not actual depictions of her face. Instead, her deaf and mute sculptures, influenced by the liberation movements of the \'60s and the Vietnam War, continue to bear silent witness to the world\'s violence.',4,'2011-06-14 15:53:31','2011-06-14 15:53:31','http://www.villagevoice.com/events/nancy-grossman-2588041/','http://vvoice.vo.llnwd.net/e14//6364684.47.jpg','',127,'event_images/68c79eacfc88c6dd0388a5bbfbfbe7de6cd2d35b_2.jpg',1,0),
