	(1039,'http://www.villagevoice.com/events/taimur-and-fahad-cem-and-rg-2623991/','Taimur & Fahad+Cem & RG','taimur-fahadcem-rg','Since they bring such great guests to their Blkmarket parties, Taimur & Fahad don\'t always get the press they deserve. But they\'re not only among the city\'s most on-point promoters, they\'re two of our best techno DJs. Fellow locals Cem & RG are among the Blkmarket alumni; they make haunting minimal techno for Berlin\'s dream-inspired label, Sleep is Commercial. With visuals by Tito Jimenez, at CVZ Contemporary.',4,'2011-06-14 15:53:33','2011-06-14 15:53:33','http://www.villagevoice.com/events/taimur-and-fahad-cem-and-rg-2623991/','http://vvoice.vo.llnwd.net/e14//6541617.47.jpg','',137,'event_images/4567cd5051e1435f97667fd44d1284509cc97b68.jpg',1,0),
