	(1137,'http://www.villagevoice.com/events/governors-ball-music-festival-2622378/','Governors Ball Music Festival','governors-ball-music-festival','\"No overlapping sets!\" trumpet the ads for this weekend\'s inaugural  Governors Ball Music Festival , and you have to admire the organizers\' marketing strategy: At a moment when most American summer festivals seem determined to overpower their competitors through sheer volume of talent, here\'s a relatively tidy one-day event at which you can (and might actually want to) see everything on the bill. Headliners include mash-up king  Girl Talk  and Aussie synth-pop weirdoes Empire of the Sun. But the undercard is solid, too, with Das Racist, Neon Indian, and Big Boi, who may or may not show off some of the tunes he\'s been working on with Modest Mouse. Need a break from the music? Beer pong, beach volleyball, basketball, ping pong, and a dance-off are all happening as well. G',4,'2011-06-14 15:53:46','2011-06-14 15:53:46','http://www.villagevoice.com/events/governors-ball-music-festival-2622378/','http://vvoice.vo.llnwd.net/e14//6533529.47.jpg','',137,'event_images/e93127f620281dc432f970762853767006768a25.jpg',1,1),
