	(1148,'http://www.villagevoice.com/events/best-coast-2609911/','Best Coast','best-coast','The Celebrate Brooklyn festival revs its engines for yet another summer season with a worthy act: Los Angeles garage-poppers  Best Coast , whose swell-heavy scraps of surf-rock distortion will sound beautifully resonant against the Brooklyn sunset. Singer Bethany Cosentino, drummer Ali Koehler (formerly of Vivian Girls), and producer/multi-instrumentalist Bobb Bruno are playing in support of last year\'s debut  Crazy for You  and this year\'s  Summer Is Forever , their split seven-inch with Wavves, both lovingly lo-fi and terrifically catchy. With some escaped librarians called the Decemberists.',4,'2011-06-14 15:53:47','2011-06-14 15:53:47','http://www.villagevoice.com/events/best-coast-2609911/','http://vvoice.vo.llnwd.net/e14//6461022.47.jpg','',137,'event_images/d33d95d1c618a6878eaf4a5f78fe206c15061d9f.jpg',1,0),
	(1149,'http://www.villagevoice.com/events/os-gemeos-1265284/','Os Gemeos','os-gemeos','Brazilian street artists Gustavo and Otavio Pandolfo mural can be seen on Houston Street and Bowery.',4,'2011-06-14 15:53:48','2011-06-14 15:53:48','http://www.villagevoice.com/events/os-gemeos-1265284/','','',139,'',1,0),
	(1150,'http://www.villagevoice.com/events/the-men-2621191/','The Men','the-men','Now ensconced in the Sacred Bones fold with the just-released  Leave Home , Brooklyn cranks the Men have their six feet firmly planted at the junction of hype and awesome. Advance track \"Bataille\" really did splinter wood and singe eyebrows, and the trio\'s checkered past of tapes and 7\" releases regularly aligned caterwaul with brain glue hooks. So who\'s to say they can\'t take the trite universe by swarm? With Milk Music, Nude Beach, and the Marsh Hens.',4,'2011-06-14 15:53:48','2011-06-14 15:53:48','http://www.villagevoice.com/events/the-men-2621191/','http://vvoice.vo.llnwd.net/e14//6533321.47.jpg','',137,'event_images/09a06c593f9a464e69a66932bd399a5f63c47a16.jpg',1,0),
