	(1156,'http://www.villagevoice.com/events/summer-2599461/','Summer','summer','Dir. Eric Rohmer (1986) The most beloved of Rohmers vacation films,  La rayon vert [The Green Ray] , also known as  Summer , showcases one of his richest charactersan exasperating, wistfully depressed fuss-budget (Marie Rivière) with an unsatisfied desire for the perfect getaway, not to mention boyfriend. HOBERMAN.',4,'2011-06-14 15:53:48','2011-06-14 15:53:48','http://www.villagevoice.com/events/summer-2599461/','','',173,'',1,4),
